import React, { Component } from 'react'
import {Button} from 'react-bootstrap'
import 'bootstrap/dist/css/bootstrap.css'
import {Link} from 'react-router-dom'
import {Navbar} from 'react-bootstrap'

export default class navbar extends Component {

    handlelogout = () => {
        localStorage.removeItem('user');
        localStorage.removeItem('cart');
    }

    render() {
        return (
            <div>
                <Navbar className="navbar navbar-light bg-light" style={{width : "100vw"}}>
                <Link to='/home'>
                <span className="home-button">Quick Buy</span>
                </Link>
                <Link to="/home/productlist">
                    <Button className="prod-bttn">Product List</Button>
                </Link>
                <Link to='/home/cart'>
                <Button variant="danger" className="cart-button"><i className="fab fa-opencart"></i>&nbsp;&nbsp;Cart</Button>
                </Link>
                <Link to="/">
                <Button className="logout-button" onClick={this.handlelogout}>Logout</Button>
                </Link>
                </Navbar>
            </div>
        )
    }
}
